Iq("immutable/option.effekt","module immutable/option\n\nimport effekt\n\ntype Option[A] {\n  None();\n  Some(value: A)\n}\n\ndef isDefined[A](self: Option[A]): Bool \x3d self match {\n  case None()  \x3d\x3e false\n  case Some(v) \x3d\x3e true\n}\n\ndef isEmpty[A](self: Option[A]): Bool \x3d\n  self.isDefined.not\n\ndef orElse[A](self: Option[A]) { that: \x3d\x3e Option[A] }: Option[A] \x3d self match {\n  case None()  \x3d\x3e that()\n  case Some(v) \x3d\x3e Some(v)\n}\n\ndef getOrElse[A](self: Option[A]) { that: \x3d\x3e A }: A \x3d self match {\n  case None() \x3d\x3e that()\n  case Some(v) \x3d\x3e v\n}\n\ndef map[A, B](self: Option[A]) { f: A \x3d\x3e B }: Option[B] \x3d self match {\n  case None()  \x3d\x3e None()\n  case Some(v) \x3d\x3e Some(f(v))\n}\n\ndef foreach[A](self: Option[A]) { f: A \x3d\x3e Unit }: Unit \x3d self match {\n  case None()  \x3d\x3e ()\n  case Some(v) \x3d\x3e f(v)\n}\n\n// Interop with JS\n// ---------------\n// These functions should only be used by libraries that interface with native JS\n\ndef undefinedToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined) { None() } else { Some(value) }\n\ndef nullToOption[A](value: A): Option[A] \x3d\n  if (value.isNull) { None() } else { Some(value) }\n\ndef nullishToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined || value.isNull) { None() } else { Some(value) }\n");
